import React from 'react';

import "./AcercaMi.scss"

const AboutMe = () => {
  return (
    <section id="about-me" className="section">
      <div className="container">
        <div className="row">
          <div className="col-md-6">
            <h2 className="section-title">Acerca de mí</h2>
            <p>
              ¡Hola! Soy [Tu Nombre], un apasionado desarrollador web con [número] años de experiencia en la creación de soluciones digitales innovadoras. Mi enfoque se centra en [tu enfoque o especialidad]. Desde [año de inicio], he tenido la oportunidad de trabajar en diversos proyectos desafiantes que me han permitido adquirir un sólido conjunto de habilidades en [tecnologías relevantes].
            </p>
            <p>
              Me encanta enfrentarme a nuevos desafíos y aprender constantemente nuevas tecnologías para mejorar mis habilidades. Mi objetivo es siempre ofrecer productos de alta calidad que satisfagan las necesidades de mis clientes y proporcionen una excelente experiencia de usuario.
            </p>
            <p>
              Fuera del trabajo, disfruto [actividades o intereses relacionados con el desarrollo web o tecnología]. Estoy emocionado de seguir creciendo profesionalmente y explorar nuevas oportunidades en el campo del desarrollo web.
            </p>
          </div>
          <div className="col-md-6">
            {/* Aquí puedes agregar una imagen tuya si lo deseas */}
            <img src="ruta/a/tu/imagen.jpg" alt="Tu Nombre" className="img-fluid" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default AboutMe;
